import React from "react";
import { Home, Search, PlusCircle, Heart, User } from "lucide-react";
import "./BottomNav.css";

function BottomNav() {
  return (
    <div className="bottom-nav">
      <Home size={24} />
      <Search size={24} />
      <PlusCircle size={28} />
      <Heart size={24} />
      <User size={24} />
    </div>
  );
}

export default BottomNav;
